				["init"] = {
					["custom"] = "-- Made by Zeler-Ravencrest EU, with great help from Stryer-Ravencrest EU\nlocal decimals = \"0\"          -- The number of decimals displayed\n\naura_env.PAoE = 0\naura_env.PSpellName = \"\"\naura_env.PSpellDamage = 0\n-- aura_env.PLevel = 112\naura_env.PImmunity = 0\naura_env.IgnoreArmor = 0\naura_env.InstanceID = select(8, GetInstanceInfo())\naura_env.DungeonDifficulty = GetDungeonDifficultyID()\n\naura_env.MAoE = 0\naura_env.MSpellName = \"\"\naura_env.MSpellDamage = 0\naura_env.MImmunity = 0\naura_env.ShadeOfXaviusTime = 0\naura_env.RokmoraHits = 1\n\n-- Sets the format of the displayed text\nlocal EndText = \":|c%s%.\" .. decimals .. \"f%%|r\"\n\n-- Color values, the accepted values are from 0 to 255\n-- The 1st value is for red, 2nd is for green and 3rd is for blue\nlocal ColorI = {0, 60, 255}  -- The color if you have an immunity active\nlocal Color1 = {255, 0, 0}   -- The color if you will have < 6% health left\nlocal Color2 = {255, 128, 0} -- The color if you will have >= 6% health left\nlocal Color3 = {0, 255, 0}   -- The color if you will have => 20% health left\n\nlocal function RGBtoHex(rgb)\n    return string.format(\"ff%02x%02x%02x\", rgb[1], rgb[2], rgb[3])\nend\n\nlocal ColorI = RGBtoHex(ColorI)\nlocal Color1 = RGBtoHex(Color1)\nlocal Color2 = RGBtoHex(Color2)\nlocal Color3 = RGBtoHex(Color3)\n\n\n-- Check player class and spec\naura_env.ClassID = select(3, UnitClass(\"player\"))\naura_env.SpecID = GetSpecialization()\n\n-- Mythic+ Function\naura_env.DungeonSpellID = {\n    -- Buffs on Enemy\n    -- Dungeon Specific\n    -- [196396] = 0.05, -- Arcway, Ivanyr Overcharge\n    [196930] = 0.50, -- BRH, The Amalgam of Souls - Soulgorge buff\n    [221315] = 0.05, -- DHT, Xavius - Apocalyptic Empowerment\n    [227257] = 2, -- Kara, Curator Overload\n    \n    -- Debuffs on enemy\n    [192132] = GetSpellInfo(192132), -- HoV, Hyrja - Mystic Empowerment: Thunder (Debuff)\n    -- Debuffs on player\n    [200580] = GetSpellInfo(200580), -- Maddening Roar debuff\n}\n\n-- Returns formatted health based on percentage\nfunction aura_env.Color(Health)\n    if Health >= 19.5 then return string.format(EndText, Color3, Health)\n    elseif Health >= 5.5 then return string.format(EndText, Color2, Health)\n    elseif Health < 5.5 then return string.format(EndText, Color1, Health)\n    end\nend\n\n\n-- NpcID, Base Damage, Ability Name, Avoidance mode (1 = AoE, 0 otherwise), Npc level, (IgnoreArmor; 1 = ignore armor)\naura_env.PDungeon = {\n    ---- Arcway ----\n    -- [98208] = {0, \" \", 0, 112, 0}, -- Advisor Vandros\n    -- [98205] = {0, \" \", 0, 112, 0}, -- Corstilax\n    [98206] = {1.549, \"Slam\", 1, 112, 0}, -- General Xakal - Wicked Slam\n    -- [98203] = {0, \" \", 0, 112, 0}, -- Ivanyr\n    -- [98207] = {0, \" \", 0, 112, 0}, -- Nal'tira\n    \n    ---- Black Rook Hold ----\n    -- [98542] = {0, \" \", 0, 112, 0}, -- Amalgam of Souls\n    -- [98696] = {0, \" \", 0, 112, 0}, -- Illysanna Ravencrest\n    [98949] = {0.8411, \"Stomp\", 1, 112, 1}, -- Smashsmite the Hateful - Earthshaking Stomp\n    -- [98970] = {0, \" \", 0, 112, 0}, -- Lord Ravencrest (Dantalionax)\n    \n    ---- Cathedral ----\n    -- [117193] = {0, \" \", 0, 112, 0}, -- Agronox\n    -- [117194] = {0, \" \", 0, 112, 0}, -- Thrashbite the Scornful\n    -- [118804] = {0, \" \", 0, 112, 0}, -- Domatrax\n    -- [116944] = {0, \" \", 0, 112, 0}, -- Mephistroth\n    \n    ---- Cour of Stars ----\n    -- [104278] = {0, \" \", 0, 111, 0}, -- Felbound Enforcer - Fel Detonation\n    -- [104215] = {0, \" \", 0, 112, 0}, -- Patrol Captain Gerdo\n    -- [104217] = {0, \" \", 0, 112, 0}, -- Talixae Flamewreath\n    -- [104218] = {0, \" \", 0, 112, 0}, -- Advisor Melandrus\n    \n    ---- Eye of Azshara ----\n    -- [91784] = {0, \" \", 0, 112, 0}, -- Warlord Parjesh - Crashing Wave\n    -- [91789] = {0, \" \", 0, 112, 0}, -- Lady Hatecoil - Focused Lightning\n    -- [91808] = {0, \" \", 0, 112, 0}, -- Serpentrix\n    -- [91797] = {0, \" \", 0, 112, 0},